let shader_module19 = device.create_shader_module(ShaderModuleDescriptor { label: Some("horizon_glitch"), source: Glsl {shader: Cow::from("#version 450\r\n\r\nlayout(location = 0) in vec2 position;\r\nlayout(location = 1) in vec4 glitch;\r\n\r\nlayout(location = 0) out vec2 postiion_cs;\r\nlayout(location = 1) out vec4 vGlitch;\r\n\r\nlayout(set = 0, binding = 0) uniform Model {\r\n    mat4 vertexMatrix;\r\n    vec4 diffuseMat;\r\n\r\n    float strength;\r\n    float fade;\r\n    float depth;\r\n    float alpha;\r\n\r\n    float src_preimultiplied;\r\n    float dst_preimultiply;\r\n    float wasm0;\r\n    float wasm1;\r\n};\r\n\r\nvoid main() {\r\n    vec2 positionGlitch = position + 0.5; // [0, 1]\r\n    positionGlitch.y = positionGlitch.y * glitch.y + glitch.x;\r\n\r\n    vec4 positionUpdate = vec4((positionGlitch - 0.5) * 2.0, 1.0, 1.0);\r\n\r\n    gl_Position = vertexMatrix * positionUpdate;\r\n    gl_Position.z = depth;\r\n\r\n    postiion_cs = positionGlitch;\r\n    postiion_cs.y = 1.0 - positionGlitch.y;\r\n\r\n    float halfSize = glitch.y / 2.;\r\n    vGlitch = vec4(halfSize, position.y + 0.5, glitch.zw);\r\n}"), stage: naga::ShaderStage::Vertex,  defines: naga::FastHashMap::default()} });    
let shader_module20 = device.create_shader_module(ShaderModuleDescriptor { label: Some("horizon_glitch"), source: Glsl {shader: Cow::from("#version 450\r\n\r\nlayout(location = 0) in vec2 postiion_cs;\r\nlayout(location = 1) in vec4 vGlitch;\r\nlayout(location = 0) out vec4 gl_FragColor;\r\n\r\nlayout(set = 0, binding = 0) uniform Model {\r\n    mat4 vertexMatrix;\r\n    vec4 diffuseMat;\r\n\r\n    float strength;\r\n    float fade;\r\n    float depth;\r\n    float alpha;\r\n    \r\n    float src_preimultiplied;\r\n    float dst_preimultiply;\r\n    float wasm0;\r\n    float wasm1;\r\n};\r\n\r\n\r\nlayout(set = 0, binding = 1) uniform texture2D diffuseTex;\r\nlayout(set = 0, binding = 2) uniform sampler sampler_diffuseTex;\r\n\r\nvec4 texColor(vec4 src) {\r\n    src.rgb /= mix(1., src.a, step(0.5, src_preimultiplied));\r\n    return src;\r\n}\r\n\r\nvoid main() {\r\n    vec2 vMainUV = postiion_cs * diffuseMat.zw + diffuseMat.xy;\r\n\r\n    float diff_u = (1.0 - smoothstep(0.5 - fade / vGlitch.x, 0.5, abs(vGlitch.y - 0.5))) * strength * diffuseMat.z;\r\n    // float diff_u = strength * diffuseMat.x;\r\n\r\n    vec4 src1 = texColor(texture(sampler2D(diffuseTex, sampler_diffuseTex), vMainUV));\r\n    vec4 src2 = texColor(texture(sampler2D(diffuseTex, sampler_diffuseTex), vMainUV + vec2(vGlitch.z * diff_u, 0.)));\r\n    vec4 src3 = texColor(texture(sampler2D(diffuseTex, sampler_diffuseTex), vMainUV + vec2(vGlitch.z * diff_u * 1.5, 0.)));\r\n\r\n    gl_FragColor = vec4(src1.r, src2.g, src3.b, (src1.a + src2.a + src3.a) * 0.333334);\r\n    gl_FragColor.a *= alpha;\r\n    gl_FragColor.rgb *= mix(1., gl_FragColor.a, step(0.5, dst_preimultiply));\r\n    // gl_FragColor = vec4(diff_u, diff_u, diff_u, 1.0);\r\n}"), stage: naga::ShaderStage::Fragment,  defines: naga::FastHashMap::default()} });    
