let shader_module21 = device.create_shader_module(ShaderModuleDescriptor { label: Some("radial_wave"), source: Glsl {shader: Cow::from("#version 450\r\n\r\nlayout(location = 0) in vec2 position;\r\nlayout(location = 0) out vec2 postiion_cs;\r\n\r\nlayout(set = 0, binding = 0) uniform Param {\r\n    mat4 vertexMatrix;\r\n    vec4 diffuseMat;\r\n\r\n    float centerx;\r\n    float centery;\r\n    float aspect_ratio;\r\n    float start;\r\n\r\n    float end;\r\n    float cycle;\r\n    float weight;\r\n    float depth;\r\n\r\n    float alpha;\r\n    float src_preimultiplied;\r\n    float dst_preimultiply;\r\n    // float wasm0;\r\n    // float wasm1;\r\n    float wasm2;\r\n};\r\n\r\nvoid main() {\r\n    vec4 positionUpdate = vec4(position * 2.0, 1.0, 1.0);\r\n\r\n    gl_Position = vertexMatrix * positionUpdate;\r\n    gl_Position.z = depth;\r\n    gl_Position.w = 1.0;\r\n\r\n    postiion_cs = position + 0.5;\r\n    postiion_cs.y = 1.0 - postiion_cs.y;\r\n}"), stage: naga::ShaderStage::Vertex,  defines: naga::FastHashMap::default()} });    
let shader_module22 = device.create_shader_module(ShaderModuleDescriptor { label: Some("radial_wave"), source: Glsl {shader: Cow::from("#version 450\r\n\r\n#define SHADER_NAME fragment:RadialWave\r\n\r\nlayout(location = 0) in vec2 postiion_cs;\r\n\r\nlayout(location = 0) out vec4 gl_FragColor;\r\n\r\nlayout(set = 0, binding = 0) uniform Param {\r\n    mat4 vertexMatrix;\r\n    vec4 diffuseMat;\r\n\r\n    float centerx;\r\n    float centery;\r\n    float aspect_ratio;\r\n    float start;\r\n\r\n    float end;\r\n    float cycle;\r\n    float weight;\r\n    float depth;\r\n\r\n    float alpha;\r\n    float src_preimultiplied;\r\n    float dst_preimultiply;\r\n    // float wasm0;\r\n    // float wasm1;\r\n    float wasm2;\r\n};\r\n\r\n\r\nlayout(set = 0, binding = 1) uniform texture2D diffuseTex;\r\nlayout(set = 0, binding = 2) uniform sampler sampler_diffuseTex;\r\n\r\nvec4 texColor(vec4 src) {\r\n    src.rgb /= mix(1., src.a, step(0.5, src_preimultiplied));\r\n    return src;\r\n}\r\n\r\nvec2 clampUV(vec2 uv, vec2 minUV, vec2 maxUV) {\r\n    return vec2(\r\n        clamp(uv.x, minUV.x, maxUV.x),\r\n        clamp(uv.y, minUV.y, maxUV.y)\r\n    );\r\n}\r\n\r\nvoid main() {\r\n    vec2 minUV = vec2(0.) * diffuseMat.zw + diffuseMat.xy;\r\n    vec2 maxUV = vec2(1.) * diffuseMat.zw + diffuseMat.xy;\r\n\r\n    vec2 vMainUV = postiion_cs * diffuseMat.zw + diffuseMat.xy;\r\n\r\n    vec2 local = postiion_cs * 2.0 - 1.0;\r\n    local.y *= aspect_ratio;\r\n\r\n    float len = distance(local, vec2(centerx, centery));\r\n    float width = end - start;\r\n    float diff = max(width / 2., 0.1);\r\n\r\n    float fade = smoothstep(start, start + diff, len) * (1.0 - smoothstep(end - diff, end, len));\r\n    float t = (len - start) / width * cycle;\r\n    diff = fade * weight * sin(t * 3.141592653589793);\r\n\r\n    gl_FragColor = texColor(texture(sampler2D(diffuseTex, sampler_diffuseTex), clampUV(vMainUV + diff * diffuseMat.zw, minUV, maxUV)));\r\n    gl_FragColor.a *= alpha;\r\n    gl_FragColor.rgb *= mix(1., gl_FragColor.a, step(0.5, dst_preimultiply));\r\n}"), stage: naga::ShaderStage::Fragment,  defines: naga::FastHashMap::default()} });    
let bind_group_layout12 = device.create_bind_group_layout(&BindGroupLayoutDescriptor { label: Some("EffectRadialWave"), entries: &[BindGroupLayoutEntry { binding: 0, visibility: ShaderStages::from_bits(3).unwrap()/*ShaderStages(VERTEX | FRAGMENT)*/, ty: BindingType::Buffer{ty:BufferBindingType::Uniform, has_dynamic_offset: false, min_binding_size: None}, count: None }, BindGroupLayoutEntry { binding: 1, visibility: ShaderStages::from_bits(2).unwrap()/*ShaderStages(FRAGMENT)*/, ty: BindingType::Texture{sample_type: TextureSampleType::Float {filterable: true}, view_dimension: TextureViewDimension::D2, multisampled: false}, count: None }, BindGroupLayoutEntry { binding: 2, visibility: ShaderStages::from_bits(2).unwrap()/*ShaderStages(FRAGMENT)*/, ty: BindingType::Sampler(SamplerBindingType::Filtering), count: None }] });    
let shader_module23 = device.create_shader_module(ShaderModuleDescriptor { label: Some("blur_gauss"), source: Glsl {shader: Cow::from("#version 450\r\n\r\nlayout(location = 0) in vec2 position;\r\n\r\nlayout(set = 0, binding = 0) uniform Model {\r\n    mat4 vertexMatrix;\r\n    vec4 diffuseMat;\r\n\r\n    // vec4 uvRegion; // uv 矩形范围、采样范围不能超过该矩形区域，因此需要该参数用于判断\r\n    vec2 textureSize; // 纹理尺寸\r\n    float blurRadius; // 模糊半径\r\n    float horizontal;\r\n\r\n    float depth;\r\n    float alpha;\r\n    float src_preimultiplied;\r\n    float dst_preimultiply;\r\n};\r\n\r\nlayout(location = 0) out float support; // 采样像素个数（大致为模糊半径的两倍，因为需要左右对称）\r\n\r\nlayout(location = 1) out vec2 vUv; // 当前点得uv坐标\r\nlayout(location = 2) out vec2 vOffsetScale; // 单个像素的uv偏移\r\nlayout(location = 3) out vec2 vGaussCoefficients; // 高斯模糊系数（由顶点着色器根据模糊半径算出）\r\nlayout(location = 4) out vec4 uvRect; \r\n\r\n// 根据半径计算高斯函数最大值（该最大值）\r\n// 高斯模糊公式： f(x) = 1/(√2πσ²) * e^-x²/2σ²\r\n// 公式中存在两个常量 A: 1/(√2πσ²), B: e^-/2σ²\r\n// 因此，该公式符合二项式定理:\r\n// 当x = 0时， f(x) = A, \r\n// 当x = 1时， f(x) = A*B, 令 C = B²\r\n// 当x = 2时， f(x) = (A*B)*C, 令C1= C*B²\r\n// 当x = 4时， f(x) = (A*B)*C1, 令C2= C1*B² ....\r\nvoid calculate_gauss_coefficients(float sigma) {\r\n\tvGaussCoefficients = vec2(1.0 / (sqrt(2.0 * 3.14159265) * sigma),\r\n                              exp(-0.5 / (sigma * sigma)));\r\n\r\n\t// x: A, y: B, z: B²\r\n    vec3 gauss_coefficient = vec3(vGaussCoefficients,\r\n                                  vGaussCoefficients.y * vGaussCoefficients.y);\r\n\t\r\n\t// 积分 对覆盖到的像素权重求和\r\n    float gauss_coefficient_total = gauss_coefficient.x;\r\n\r\n\t// int support = int(ceil(support));\r\n    for (float i = 1.0; i <= 300.0; i += 2.0) {\r\n\t\tif (i > support) {\r\n\t\t\tbreak;\r\n\t\t}\r\n        gauss_coefficient.xy *= gauss_coefficient.yz;\r\n        float gauss_coefficient_subtotal = gauss_coefficient.x;\r\n        gauss_coefficient.xy *= gauss_coefficient.yz;\r\n        gauss_coefficient_subtotal += gauss_coefficient.x;\r\n\r\n\t\t// 除x=0的像素，其他像素都是对称的，所以乘2\r\n        gauss_coefficient_total += 2.0 * gauss_coefficient_subtotal;\r\n    }\r\n\r\n\t// 求x=0是的权重值（原权重/总权重，因为求值过程是乘的操作，因此用该值重复上面的计算，可得到其他像素的新权重）\r\n    vGaussCoefficients.x = vGaussCoefficients.x/gauss_coefficient_total;\r\n}\r\n\r\nvoid main() {\r\n    vec4 positionUpdate = vec4(position * 2.0, 1.0, 1.0);\r\n\r\n    gl_Position = vertexMatrix * positionUpdate;\r\n    gl_Position.z = depth;\r\n\r\n    vUv = position + 0.5;\r\n    vUv.y = 1.0 - vUv.y;\r\n\r\n\tsupport = blurRadius;\r\n\tsupport = ceil(1.5 * blurRadius) * 2.0;\r\n    if (support > 0.0) {\r\n\t\t// 以σ为blurRadius来计算权重值\r\n        calculate_gauss_coefficients(blurRadius);\r\n    } else {\r\n\t\t// support不大于0，则默认为1.0\r\n        vGaussCoefficients = vec2(1.0, 1.0);\r\n    }\r\n\r\n\t// 计算一个像素在纹理上的uv偏移（0~1的数）\r\n\tvOffsetScale = mix(vec2(0., textureSize.y), vec2(textureSize.x, 0.), step(0.01, horizontal));\r\n\r\n\t// 像素单位计算到uv单位，因为是采用线性采样，为防止溢出，这里会有一定偏移\r\n\t// uvRect = vec4(uvRegion.xy + 0.5, uvRegion.zw - 0.5) / textureSize.xyxy;\r\n\tuvRect = vec4(diffuseMat.xy + textureSize * 0.5, diffuseMat.zw + diffuseMat.xy - textureSize * 0.5);\r\n\r\n\tvUv = vUv * diffuseMat.zw + diffuseMat.xy;\r\n}"), stage: naga::ShaderStage::Vertex,  defines: naga::FastHashMap::default()} });    
let shader_module24 = device.create_shader_module(ShaderModuleDescriptor { label: Some("blur_gauss"), source: Glsl {shader: Cow::from("#version 450\r\n\r\nlayout(set = 0, binding = 0) uniform Model {\r\n    mat4 vertexMatrix;\r\n    vec4 diffuseMat;\r\n\r\n    // vec4 uvRegion; // uv 矩形范围、采样范围不能超过该矩形区域，因此需要该参数用于判断\r\n    vec2 textureSize; // 纹理尺寸\r\n    float blurRadius; // 模糊半径\r\n    float horizontal;\r\n\r\n    float depth;\r\n    float alpha;\r\n    float src_preimultiplied;\r\n    float dst_preimultiply;\r\n};\r\n\r\nlayout(set = 0, binding = 1) uniform texture2D diffuseTex;\r\nlayout(set = 0, binding = 2) uniform sampler sampler_diffuseTex;\r\n\r\nlayout(location = 0) in float support; // 采样像素个数（大致为模糊半径的两倍，因为需要左右对称）\r\n\r\nlayout(location = 1) in vec2 vUv; // 当前点得uv坐标\r\nlayout(location = 2) in vec2 vOffsetScale; // 单个像素的uv偏移\r\nlayout(location = 3) in vec2 vGaussCoefficients; // 高斯模糊系数（由顶点着色器根据模糊半径算出）\r\nlayout(location = 4) in vec4 uvRect; \r\n\r\nlayout(location = 0) out vec4 gl_FragColor;\r\n\r\nvec4 texColor(vec4 src) {\r\n    src.rgb /= mix(1., src.a, step(0.5, src_preimultiplied));\r\n    return src;\r\n}\r\n\r\nvoid main() {\r\n    vec4 original_color = texColor(texture(sampler2D(diffuseTex, sampler_diffuseTex), vUv));\r\n\r\n    // Incremental Gaussian Coefficent Calculation (See GPU Gems 3 pp. 877 - 889)\r\n    vec3 gauss_coefficient = vec3(vGaussCoefficients,\r\n                                vGaussCoefficients.y * vGaussCoefficients.y);\r\n    // 当前采样点的权重\r\n    vec4 avg_color = original_color * gauss_coefficient.x;\r\n    \r\n    // 其他权重的点的采样（左右需要对称）\r\n    for (float i = 1.0; i <= 300.0; i += 2.0) {\r\n        if (i > support) {\r\n            break;\r\n        }\r\n        gauss_coefficient.xy *= gauss_coefficient.yz;\r\n        float gauss_coefficient_subtotal = gauss_coefficient.x;\r\n        gauss_coefficient.xy *= gauss_coefficient.yz;\r\n        gauss_coefficient_subtotal += gauss_coefficient.x;\r\n\r\n        float gauss_ratio = gauss_coefficient.x / gauss_coefficient_subtotal;\r\n        vec2 offset = vOffsetScale * (i + gauss_ratio);\r\n        \r\n        // 计算负方向和正方向上偏移的像素的像素值\r\n        vec2 st0 = vUv - offset;\r\n        vec2 st1 = vUv + offset;\r\n        st0 = vec2(max(st0.x, uvRect.x), max(st0.y, uvRect.y));\r\n        st1 = vec2(min(st1.x, uvRect.z), min(st1.y, uvRect.w));\r\n        avg_color += (texColor(texture(sampler2D(diffuseTex, sampler_diffuseTex), st0)) + texColor(texture(sampler2D(diffuseTex, sampler_diffuseTex), st1))) *\r\n                    gauss_coefficient_subtotal;\r\n                    \r\n    }\r\n\r\n    // 输出颜色值\r\n    gl_FragColor = avg_color;\r\n    gl_FragColor.a *= alpha;\r\n    gl_FragColor.rgb *= mix(1., gl_FragColor.a, step(0.5, dst_preimultiply));\r\n\r\n    // gl_FragColor=vec4(0.0, )\r\n}\r\n"), stage: naga::ShaderStage::Fragment,  defines: naga::FastHashMap::default()} });    
