let shader_module25 = device.create_shader_module(ShaderModuleDescriptor { label: Some("image_mask"), source: Glsl {shader: Cow::from("#version 450\r\n\r\nlayout(location = 0) in vec2 position;\r\n\r\nlayout(location = 0) out vec2 vUV;\r\nlayout(location = 1) out vec2 vUV2;\r\n\r\nlayout(set = 0, binding = 0) uniform Model {\r\n    mat4 vertexMatrix;\r\n    vec4 diffuseMat;\r\n\r\n    vec4 maskMat;\r\n\r\n    float maskFactor;\r\n    float maskMode;\r\n    float depth;\r\n    float alpha;\r\n\r\n    float src_preimultiplied;\r\n    float dst_preimultiply;\r\n    float wasm0;\r\n    float wasm1;\r\n};\r\n\r\nvoid main() {\r\n    vec4 positionUpdate = vec4(position * 2.0, 1.0, 1.0);\r\n\r\n    gl_Position = vertexMatrix * positionUpdate;\r\n    gl_Position.z = depth;\r\n\r\n    vec2 uv = position + 0.5;\r\n    uv.y = 1.0 - uv.y;\r\n\r\n    vUV = uv * diffuseMat.zw + diffuseMat.xy;\r\n    vUV2 = uv * maskMat.zw + maskMat.xy;\r\n}"), stage: naga::ShaderStage::Vertex,  defines: naga::FastHashMap::default()} });    
let shader_module26 = device.create_shader_module(ShaderModuleDescriptor { label: Some("image_mask"), source: Glsl {shader: Cow::from("#version 450\r\n\r\nlayout(set = 0, binding = 0) uniform Param {\r\n    mat4 vertexMatrix;\r\n    vec4 diffuseMat;\r\n\r\n    vec4 maskMat;\r\n\r\n    float maskFactor;\r\n    float maskMode;\r\n    float depth;\r\n    float alpha;\r\n\r\n    float src_preimultiplied;\r\n    float dst_preimultiply;\r\n    float wasm0;\r\n    float wasm1;\r\n};\r\n\r\nlayout(set = 0, binding = 1) uniform texture2D diffuseTex;\r\nlayout(set = 0, binding = 2) uniform sampler sampler_diffuseTex;\r\n\r\nlayout(set = 0, binding = 3) uniform texture2D maskTex;\r\nlayout(set = 0, binding = 4) uniform sampler sampler_maskTex;\r\n\r\nlayout(location = 0) in vec2 vUV;\r\nlayout(location = 1) in vec2 vUV2;\r\n\r\nlayout(location = 0) out vec4 gl_FragColor;\r\n\r\nvec4 texColor(vec4 src) {\r\n    src.rgb /= mix(1., src.a, step(0.5, src_preimultiplied));\r\n    return src;\r\n}\r\n\r\nvoid main() {\r\n    vec4 baseColor  = texColor(texture(sampler2D(diffuseTex, sampler_diffuseTex), vUV));\r\n    float maskValue = texColor(texture(sampler2D(maskTex, sampler_maskTex), vUV2)).r;\r\n    maskValue = maskValue * 0.990 + 0.005;\r\n\r\n    if (maskMode > 0.5) {\r\n        baseColor.a *= step(maskFactor, maskValue) * maskValue;\r\n    } else {\r\n        baseColor *= step(maskFactor, maskValue);\r\n    }\r\n\r\n\r\n    gl_FragColor = baseColor;\r\n    gl_FragColor.a *= alpha;\r\n    gl_FragColor.rgb *= mix(1., gl_FragColor.a, step(0.5, dst_preimultiply));\r\n}"), stage: naga::ShaderStage::Fragment,  defines: naga::FastHashMap::default()} });    
